import React, { useState } from 'react';
import './test.css';

const students = [
    { id: 1, name: 'Sam' },
    { id: 2, name: 'Joe' },
    { id: 3, name: 'Sarah' },
    { id: 4, name: 'Johan' },
    { id: 5, name: 'Emily' },
    { id: 6, name: 'Michael' },
    { id: 7, name: 'Amanda' },
    { id: 8, name: 'David' },
    { id: 9, name: 'Jessica' },
    { id: 10, name: 'Daniel' },
    { id: 11, name: 'Sophia' },
    { id: 12, name: 'Robert' },
    { id: 13, name: 'Olivia' },
    { id: 14, name: 'Chris' },
    { id: 15, name: 'Isabella' },
    { id: 16, name: 'John' },
    { id: 17, name: 'Mia' },
    { id: 18, name: 'Jacob' },
    { id: 19, name: 'Grace' },
    { id: 20, name: 'Ethan' },
    { id: 21, name: 'Lily' },
    { id: 22, name: 'Matthew' },
    { id: 23, name: 'Zoe' },
    { id: 24, name: 'Lucas' },
    { id: 25, name: 'Ava' },
    { id: 26, name: 'Mason' },
    { id: 27, name: 'Ella' },
    { id: 28, name: 'Liam' },
    { id: 29, name: 'Chloe' },
    { id: 30, name: 'James' },
    { id: 31, name: 'Abigail' },
    { id: 32, name: 'Henry' },
    { id: 33, name: 'Natalie' },
    { id: 34, name: 'Logan' },
    { id: 35, name: 'Hannah' },
  ];

const StudentList = () => {
  const [searchTerm, setSearchTerm] = useState('');

  // Filter students based on the search term
  const filteredStudents = students.filter(student =>
    student.name.toLowerCase().startsWith(searchTerm.toLowerCase())
  );

  // Clear the search bar
  const clearSearch = () => {
    setSearchTerm('');
  };

  return (
    <div>
      <input
        type="text"
        placeholder="Search by name..."
        value={searchTerm}
        onChange={(e) => setSearchTerm(e.target.value)}
      />
      <button onClick={clearSearch}>x</button>

      <ul>
        {filteredStudents.map(student => (
          <li key={student.id}>{student.name}</li>
        ))}
      </ul>
    </div>
  );
};

export default StudentList;
